import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export class SignUp extends Component {
    
    render() {
        return (
            <div>
                <h1>Welcome to SignUp</h1>
                <link to="/login" className="btn btn-primary">Login</link>
            </div>
        );
    }
}
